import React from "react";

export const TransactionsCard = ({name, amount, date}) => {
    return (
        <div>
            <ul>
            <li>Name:{name} &nbsp;  Amount:{amount} &nbsp; Date:{date}  </li>   
            </ul>

        </div>
    )
}
